pub enum LoxError {
    Error {
            line: usize,
            message: String,
        },
}

pub enum Expr {
    Binary {
            left: Box<Expr>,
            operator: Token,
            right: Box<Expr>,
        },
    Unary {
            operator: Token,
            right: Box<Expr>,
        },
    Grouping {
            expression: Box<Expr>,
        },
    Literal {
            value: Literal,
        },
}
